INSERT INTO `toy_createidea` VALUES ('484259990', '123', '<p>123</p>', 0x68747470733A2F2F7373312E62616964752E636F6D2F364F4E58736A69703051495A387479686E712F69742F753D343031343339373731342C3139323633373331363826666D3D313733266170703D343926663D4A5045473F773D36343026683D33353826733D4535333638363734433633313745333730363936443034333033303041303938, null, '1', '11', '21', '31', null, '4', '2019-11-10 10:03:32', '1111', null, '36', '36', '4', null, null, null, null, '2', '4', '2019-11-11 01:39:41', '', null, null, null);
INSERT INTO `toy_createidea` VALUES ('585507432', '123', '<p>12312333</p>', 0x68747470733A2F2F7373312E62616964752E636F6D2F364F4E58736A69703051495A387479686E712F69742F753D343031343339373731342C3139323633373331363826666D3D313733266170703D343926663D4A5045473F773D36343026683D33353826733D4535333638363734433633313745333730363936443034333033303041303938, null, '1', '11', '21', '31', null, '2', '2019-11-10 10:20:24', '1111', null, '42', '42', '2', null, null, null, null, null, '9999', null, null, null, null, null);
INSERT INTO `toy_createidea` VALUES ('731929198', '管道旅行', '<p>上传者：昭阳<br></p><p>准备材料：纸盒、纸筒、胶水、彩色颜料、剪刀</p><p>构建类游戏深受宝宝们的喜爱，不仅可以培养孩子的空间感，还能锻炼孩子的手眼协调能力！</p><p><img height=\"407.672px\" width=\"612px\" src=\"http://5b0988e595225.cdn.sohucs.com/images/20180601/75b1722606ef4a51923e7a5c911f0ba4.jpeg\"></p>', 0x687474703A2F2F356230393838653539353232352E63646E2E736F687563732E636F6D2F696D616765732F32303138303630312F37356231373232363036656634613531393233653761356339313166306261342E6A706567, null, '2', '11', '22', '31', null, '2', '2019-10-21 01:35:52', '1111', null, '40', '40', '1', null, null, null, null, null, '9999', null, null, null, null, null);
INSERT INTO `toy_createidea` VALUES ('735271277', '有趣的扑克', '<p>准备材料：纸箱、扑克牌、剪刀、胶水等<br></p><p>扑克牌变身教玩具，充分锻炼幼儿对数字的敏感度，还有多种有趣的玩法！</p><p>扑克牌点数比大小。</p><p><img height=\"612px\" width=\"612px\" src=\"http://5b0988e595225.cdn.sohucs.com/images/20180601/3f7edb56e6ee417f976f465d07622018.jpeg\"></p>', 0x687474703A2F2F356230393838653539353232352E63646E2E736F687563732E636F6D2F696D616765732F32303138303630312F33663765646235366536656534313766393736663436356430373632323031382E6A706567, null, '2', '11', '27', '36', null, '2', '2019-10-21 01:36:25', '1111', null, '34', '34', '1', null, null, null, null, null, '9999', null, null, null, null, null);
INSERT INTO `toy_createidea` VALUES ('739383890', '迷宫大作战', '<p>准备材料：纸箱、纸板。胶水、剪刀、画笔、小木球<br></p><p>小球怎样才能走出迷宫呢？</p><p>这个有趣的教玩具可以让孩子开动脑筋、仔细观察，思充分锻炼思维能力和逻辑判断能力！</p><p><img height=\"612px\" width=\"612px\" src=\"http://5b0988e595225.cdn.sohucs.com/images/20180601/3883f37fc721477b81fb1860ee282a68.jpeg\"></p>', 0x687474703A2F2F356230393838653539353232352E63646E2E736F687563732E636F6D2F696D616765732F32303138303630312F33383833663337666337323134373762383166623138363065653238326136382E6A706567, null, '2', '12', '27', '39', null, '2', '2019-10-21 01:37:06', '1111', null, '54', '54', '1', null, null, null, null, null, '9999', null, null, null, null, null);
INSERT INTO `toy_createidea` VALUES ('741734151', '寻找宝藏', '<p>准备材料：木板、小圆酒塞、黏土、彩笔、透明胶带、白乳胶、骰子<br></p><p>这是一款幼儿园老师自制的“跳棋”游戏，既能锻炼孩子的动手动脑能力，又能让孩子得到空间概念和逻辑思维能力的训练。</p><p><img height=\"816.625px\" width=\"612px\" src=\"http://5b0988e595225.cdn.sohucs.com/images/20180601/5e29980827004852a5bd605660939da0.jpeg\"></p>', 0x687474703A2F2F356230393838653539353232352E63646E2E736F687563732E636F6D2F696D616765732F32303138303630312F35653239393830383237303034383532613562643630353636303933396461302E6A706567, null, '2', '11', '27', '34', null, '2', '2019-10-21 01:37:30', '1111', null, '18', '18', '1', null, null, null, null, null, '9999', null, null, null, null, null);
INSERT INTO `toy_createidea` VALUES ('744263383', '开锁匠', '<p>准备材料：锁头、卡纸、彩笔、剪刀<br></p><p>钥匙和小锁的配对看似寻常却，通过不一样的规则要求却能玩出多种花样呢！</p><p><img height=\"816.625px\" width=\"612px\" src=\"http://5b0988e595225.cdn.sohucs.com/images/20180601/32ff1b1b85304da2ab0ecea2194b30a8.jpeg\"></p>', 0x687474703A2F2F356230393838653539353232352E63646E2E736F687563732E636F6D2F696D616765732F32303138303630312F33326666316231623835333034646132616230656365613231393462333061382E6A706567, null, '2', '12', '27', '31', null, '2', '2019-10-21 01:37:55', '1111', null, '12', '12', '1', null, null, null, null, null, '9999', null, null, null, null, null);
INSERT INTO `toy_createidea` VALUES ('747752533', '快车一号', '<p>准备材料：废旧塑料筐、木板、轮子<br></p><p>废旧塑料筐制作出的趣味小火车，充分锻炼孩子的平衡能力，让孩子们爱上户外活动！</p><p><img height=\"458.516px\" width=\"612px\" src=\"http://5b0988e595225.cdn.sohucs.com/images/20180601/321e50820a5242fb8460f7480b739806.jpeg\"></p><p>呜呜呜...开车咯！</p><p><img height=\"815.359px\" width=\"612px\" src=\"http://5b0988e595225.cdn.sohucs.com/images/20180601/9bcb337f3b614e51967cb020e5886524.jpeg\"></p>', 0x687474703A2F2F356230393838653539353232352E63646E2E736F687563732E636F6D2F696D616765732F32303138303630312F33323165353038323061353234326662383436306637343830623733393830362E6A706567, null, '1', '11', '21', '33', null, '2', '2019-10-21 01:38:30', '1111', null, '34', '34', '1', null, null, null, null, null, '9999', null, null, null, null, null);
INSERT INTO `toy_createidea` VALUES ('785516228', '趣味保龄球', '<p>准备材料：塑料瓶、纸球、纸箱、纸筒等<br></p><p>利用废旧材料制作出的保龄球教玩具，简单又有创意，一定会深得小朋友们的喜爱！</p><p><img height=\"848.313px\" width=\"612px\" src=\"http://5b0988e595225.cdn.sohucs.com/images/20180601/3bb82a727b83470baadf833b32a12b6c.jpeg\"></p><p>一物两用，还可以用来玩套圈游戏哦！</p><p><img height=\"815.359px\" width=\"612px\" src=\"http://5b0988e595225.cdn.sohucs.com/images/20180601/cb2dbf9a937046f69e24a1b9a2ec2ee8.jpeg\"></p>', 0x687474703A2F2F356230393838653539353232352E63646E2E736F687563732E636F6D2F696D616765732F32303138303630312F33626238326137323762383334373062616164663833336233326131326236632E6A706567, null, '2', '11', '21', '31', null, '2', '2019-10-21 01:44:48', '1111', null, '16', '16', '1', null, null, null, null, null, '9999', null, null, null, null, null);
INSERT INTO `toy_createidea` VALUES ('788128873', '中班娃娃机', '<p>准备材料：硬纸板、针管、输液管、雪糕棒、PVC管<br></p><p>瞧，教室里多了一台娃娃机，我们来比赛谁抓的娃娃多吧！</p><p><img height=\"815.359px\" width=\"612px\" src=\"http://5b0988e595225.cdn.sohucs.com/images/20180601/5310208b4bb24ea4aad3015139ca853e.jpeg\"></p>', 0x687474703A2F2F356230393838653539353232352E63646E2E736F687563732E636F6D2F696D616765732F32303138303630312F35333130323038623462623234656134616164333031353133396361383533652E6A706567, null, '2', '11', '21', '33', null, '2', '2019-10-21 01:45:14', '1111', null, '20', '20', '1', null, null, null, null, null, '9999', null, null, null, null, null);
INSERT INTO `toy_createidea` VALUES ('791230179', '百变方块', '<p>准备材料：不织布、魔术贴等<br></p><p>这种教玩具的材料轻便环保，玩法多样，适用于各年龄段的小朋友哦！</p><p>让我们来看看都有哪些有趣的玩法吧？</p><p><img height=\"918px\" width=\"612px\" src=\"http://5b0988e595225.cdn.sohucs.com/images/20180601/4217a9583d6e443dbb77795593304d6d.jpeg\"></p><p>剪刀石头布的跳棋小游戏，看看谁先到达终点！</p><p><img height=\"816.625px\" width=\"612px\" src=\"http://5b0988e595225.cdn.sohucs.com/images/20180601/d2c6d24534134b42a6a0dbd51fc7b2d5.jpeg\"></p><p>脚印手印的对应小游戏、数字排列游戏...哇，玩法真是太多了！</p><p><img height=\"815.672px\" width=\"612px\" src=\"http://5b0988e595225.cdn.sohucs.com/images/20180601/76bc3a348a5648b3b7ea3e3c4ce80e94.jpeg\"></p>', 0x687474703A2F2F356230393838653539353232352E63646E2E736F687563732E636F6D2F696D616765732F32303138303630312F34323137613935383364366534343364626237373739353539333330346436642E6A706567, null, '2', '11', '21', '31', null, '2', '2019-10-21 01:45:45', '1111', null, '10', '10', '1', null, null, null, null, null, '9999', null, null, null, null, null);
INSERT INTO `toy_createidea` VALUES ('794618915', '我是小小演奏家', '<p>准备材料：塑料棒、塑料瓶、废旧铁桶等<br></p><p>废旧的塑料瓶、小铁桶不要扔，把它们收集起来，制作出一面音乐墙面吧！</p><p><img height=\"407.672px\" width=\"612px\" src=\"http://5b0988e595225.cdn.sohucs.com/images/20180601/9e1baeb0eeed459185fcd14913a81130.jpeg\"></p><p><img height=\"407.672px\" width=\"612px\" src=\"http://5b0988e595225.cdn.sohucs.com/images/20180601/ddfc8387f1db4c66bab676029a5b884c.jpeg\"></p>', 0x687474703A2F2F356230393838653539353232352E63646E2E736F687563732E636F6D2F696D616765732F32303138303630312F39653162616562306565656434353931383566636431343931336138313133302E6A706567, null, '2', '12', '22', '36', null, '1', '2019-10-21 01:46:19', '1111', null, '14', '14', '1', null, null, null, null, '1', '2', '2019-11-10 05:31:11', '123', null, null, null);
INSERT INTO `toy_createidea` VALUES ('797945749', '打击乐器', '<p>准备材料：竹管、麻绳等<br></p><p>长长短短的竹筒可以敲打出不一样的音律，这是为什么呢？老师们可以在击打乐器的同时引导孩子们进行思考哦~</p><p><img height=\"816.625px\" width=\"612px\" src=\"http://5b0988e595225.cdn.sohucs.com/images/20180601/6da22e42f0b9493091e22d028d703c73.jpeg\"></p>', 0x687474703A2F2F356230393838653539353232352E63646E2E736F687563732E636F6D2F696D616765732F32303138303630312F36646132326534326630623934393330393165323264303238643730336337332E6A706567, null, '1', '18', '22', '36', null, '2', '2019-10-21 01:46:52', '1111', null, '12', '12', '1', null, null, null, null, null, '9999', null, null, null, null, null);
